import numpy as np
# import crypto_.prime as prime
import prime


def keys():
    # p,q
    while True:
        p = np.random.randint(1000, 1e+7)
        if prime.is_prime(p):
            break
    while True:
        q = np.random.randint(1000, 1e+7)
        if prime.is_prime(q):
            break
    # n,l
    n, l = p * q, (p - 1) * (q - 1)

    e = 0
    while True:
        e = np.random.randint(1, l - 1)
        if prime.gcd(l, e) == 1:
            # e = 13
            break
    _, _, y = prime.extended_gcd(l, e)
    d = y % l

    # P,S
    P, S = (n, e), (n, d)
    return P, S


def encrypt(M, n, e):
    return (M ** e) % n


def decrypt(C, n, d):
    return (C ** d) % n


